import React from "react";
import { createChatBotMessage } from 'react-chatbot-kit';

const config = {
    botName:"Beta",
  initialMessages: [createChatBotMessage(`Type hello to start!`)],
  customStyles: {
    botMessageBox: {
      backgroundColor: '#02edd6',
    },
    chatButton: {
      backgroundColor: '#02edd6',
    },
  },
};

export default config;
